import props from "../data/data"
import RealEstat from "./real-estat"
function getButtons(){
    let numOfButtons=props.length/8;
    let list=[];
    for(let i=0;i<numOfButtons;i++){
        list.push(<span className="pageButtons"><button key={i} onClick="changepage()">{i}</button></span>)
    }
    return list
}
const Home = () => (
    <div className="display">
        <div className="proportes">{
        props.map(item=>{
            return(
                <div className="item" >
            <RealEstat key={item.id} item={item}></RealEstat>
            
            </div>
                )
        })}
        </div>

        <div className="buttonsGroup"> 
        {
            getButtons()
        }
    </div>
     <style jsx>{`
                .display{
                    display:flex;
                    flex-direction:column;
                }
                .pageButtons Button{
                    margin-right:3%;
                    min-width:30px;
                    min-height:50px;
                }
                .buttonsGroup{
                    display:flex;
                    flex-direction:row;
                                }
                  .proportes{
                  display: flex;
                  max-width:85%;
                  margin-right:auto;
                  margin-left:auto;
                  margin-top:3%;
                  flex-direction: row;
                  flex-wrap: wrap;
                  justify-content: space-around;
                  max-height: 100vh;
                  width:100%
                  }
                  .item{
                    width:24%
                  }
                  
                  @media only screen and (max-width: 700px) {
                    .main-flex{
                      width: 100%;
                      display: flex;
                      flex-direction: column;
                  
                    }
                  
                    .flexitems{
                      max-width: 99vw;
                      min-width: 99vw;
                  
                    }
                    .search-container{
                      min-width: 50%;
                      max-width: auto;
                      display: flex;
                      flex-direction: row;
                      justify-content: space-around;
                      margin-right: auto;
                      margin-left: auto;
                    }
                    app-search{
                      width: 100%;
                    float: right;
                    }
                    .container{
                      margin-top: 0;
                    }
                  }
                  @media only screen and (max-width: 700px) {
                    .filters{
                      font-size: 1vw;
                    }
                  .item{
                    width: 45%;
                    margin-left: 2%;
                  }
                  
                  }
                  @media only screen and (min-width: 2000px) {
                  
                    .item{
                      width: 350px !important;
                      margin-left: 2%;
                    }
                  
                    }
                  
                  
                  
                
                ` }
                
            </style>
    </div>
 
)

   
  export default Home;
